  return (
    <div className="App">
      <header className="App-header">

        <div className="pure-g">
          <div className="pure-u-1-3"><p>Thirds</p></div>
          <div className="pure-u-1-3"><p>Thirds</p></div>
          <div className="pure-u-1-3"><p>Thirds</p></div>
        </div>

      </header>
    </div>
  );
}

export default App;
